import ReactDOM from 'react-dom/client';
import './index.css';

class App extends Component{
  render(){
    return(
      <div className='App'>
        <h1>Hello I'm imad!</h1>
      </div>
    )

  }
}
const heading = <h1>Hello</h1>

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App/>
  </React.StrictMode>
);

